    render() {
        const bg='#060b26'
        return (
                <Navbar  style={{backgroundColor:{bg},position:`absolute`}} expand="lg">
  <Navbar.Brand href="#home">Header</Navbar.Brand>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav" className="justify-content-end">
    <Nav.Link href="#home">Dashboard</Nav.Link>
    <Nav.Link href="#home">Notifications</Nav.Link>
    <Nav.Link href="#home">Profle</Nav.Link>
    <NavDropdown alignRight title="Settings" class="justify-content-end" id="basic-nav-dropdown">
    <NavDropdown.Item >Settings</NavDropdown.Item>
    <NavDropdown.Item >Sign Out</NavDropdown.Item>
    </NavDropdown>

    </Navbar.Collapse>
</Navbar>


        )
    }
}

export default Header
